import Head from "next/head";
import Layout from "../component/Layout";
import NewsFeedItem from "../component/NewsFeedItem";

const newsFeedItemList = [
  { src: "./tiger.jpg", title: "Tiger" },
  { src: "./turtle.jpg", title: "Turtle" },
  { src: "./sambar-deer.jpg", title: "Samber Deer" },
  { src: "./squirrel.jpg", title: "Squirrel" },
  { src: "./pupy.jpg", title: "Pupy" },
];

export default function Home() {
  return (
    <Layout>
      <div>
        {newsFeedItemList.map((item, key) => {
          return <NewsFeedItem key={key} detail={item} />;
        })}
      </div>
    </Layout>
  );
}
